export const fetchPhotos = async () => {
  try {
    const response = await fetch(
      "http://test-backend.itdelta.agency/api/images"
    )
    const result = await response.json()
    console.log(result)
    console.log([] ? true : false)
    return result
  } catch (error) {
    throw new Error(error)
  }
}
